        short_description: '<b>Dyson Airwrap\u2122 <\/b>styler Complete Long (Nickel\/Fuchsia) Includes all Dyson Airwrap\u2122 styler attachments\nEngineered for different hair types\nSuitable for hair length that sits below the shoulder or is longer than 15 inches<br><br>Curl. Wave. Smooth. Dry.\n <br> <br>\nWith no extreme heat.\n <br> <br>\nUsing direct extreme heat alone, like some conventional hair curlers, can create tight, flat curls. <br> <br>\nThe Dyson Airwrap\u2122&nbsp;styler uses air to curl, creating voluminous, natural-looking curls and waves. <br> <br>\n\nHarnessing an aerodynamic phenomenon called the Coanda effect, the Dyson smoothing brushes attract hair to the surface of the brush, propelling air along the hair strands, to mimic a stylist\u2019s blow-dry technique.\n <br> <br>\nThe Dyson Airwrap\u2122&nbsp;styler is engineered to style your hair from damp. By combining the water in your hair with powerful airflow and controlled heat, it can style and dry at the same time \u2013 with no extreme heat.\n <br> <br>\nThe Dyson Airwrap\u2122&nbsp;styler comes with 6 different styling attachments for different styles:\n <br> <br>\n30mm Airwrap\u2122 long barrels <br>\nEngineered especially for chest-length and longer hair. Creates voluminous curls in medium-density hair or flowing waves for finer hair.\n  <br> <br>\n40mm Airwrap\u2122 long barrels <br>\nEngineered especially for chest-length and longer hair. Produces glamorous curls and bouncy waves. <br> <br>\n\nFirm smoothing brush<br>\nCreates a straighter style with less frizz and fewer flyaways. With firm bristles engineered to control unruly, frizz-prone hair. <br> <br>\n\nSoft smoothing brush <br>\nCreates a smooth, blow-dry finish. With soft, ball-tip bristles engineered to be gentle on the scalp. <br> <br>\n\nRound volumising brush <br>\nDirects air into the hair to give body, and the bristles create tension to shape hair as it dries.\n <br> <br>\nPre-styling dryer <br>\nTakes hair from wet to damp, ready for styling. <br> <br>\n\nFeatures <br>\nPowered by the Dyson digital motor V9 <br>\nIts 13-blade impeller spins at up to 110,000rpm, generating 3.2kPa of pressure - enough to create the Coanda effect. <br> <br>\n\nNo extreme heat <br>\nIntelligent heat control measures airflow temperature over 40 times a second and regulates heat, to ensure it always stays below 150\u00b0C.\n <br> <br>\nAttracts and wraps hair, using air <br>\nThe Coanda effect attracts hair to the barrel, then wraps it for you. No clamping, gloves or awkward winding mechanisms. Just voluminous curls and waves.\n <br> <br>\nStyles and dries simultaneously <br>\nThe Dyson Airwrap\u2122&nbsp;styler combines powerful airflow with controlled heat, to dry and style your hair from damp \u2013 with no extreme heat.\n <br> <br>\nCoanda to smooth <br>\nThe smoothing brushes harness the Coanda effect to attract hair to the surface of the brush, propelling air along the strands, to mimic a stylist\u2019s blow-dry technique.\n <br> <br>\nStorage case <br>\nProtects and neatly stores your Dyson Airwrap\u2122&nbsp;styler and its attachments. Finished in tan, cushioned with soft fabric, and secured by a magnetic clasp.\n <br> <br>\nProduct Specifications <br>\nProduct weight: 618g <br>\nCable length: 2m <br>\nPower: 1200W <br> <br>\n\nWhat\u2019s in the box: <br>\n- Dyson Airwrap\u2122&nbsp;styler Fuchsia\/Iron\/Nickel <br>\n- 30mm Airwrap\u2122&nbsp;long barrels <br>\n- 40mm Airwrap\u2122&nbsp;long barrels <br>\n- Firm smoothing brush <br>\n- Soft smoothing brush <br>\n- Round volumising brush <br>\n- Pre-styling dryer <br>\n- Non-slip heat-resistant mat <br>\n- Tan storage case\n <br> <br>\nWarranty: <br>\n2 year Dyson guarantee',
